import React from 'react';
import Header from './components/header';
import Homepage from './pages/homepage';
import {BrowserRouter as Router, Routes, Route,} from 'react-router-dom'

function App() {
  return (
    <>
    <Router>
      <Header />
      <Routes>
        <Route path='/' component={Homepage} />
      </Routes>
    </Router>
    </>
  );
}

export default App;
